(227, 'theme_mods_hashone', 'a:44:{s:18:"custom_css_post_id";i:-1;s:22:"hashone_page_header_bg";s:0:"";s:29:"hashone_disable_portfolio_sec";s:2:"on";s:20:"hashone_slider_page1";i:0;s:17:"hashone_header_bg";s:8:"hs-white";s:11:"custom_logo";s:0:"";s:11:"header_text";i:1;s:16:"background_image";s:89:"http://localhost:8888/wp-content/uploads/2017/02/A1335B2B-A176-4A94-B33C-65A59571ED20.jpg";s:17:"background_preset";s:4:"fill";s:21:"background_position_x";s:6:"center";s:21:"background_position_y";s:6:"center";s:15:"background_size";s:5:"cover";s:17:"background_repeat";s:9:"no-repeat";s:21:"background_attachment";s:5:"fixed";s:16:"background_color";s:6:"ffffff";s:11:"home_layout";a:1:{i:0;s:12:"blog_section";}s:15:"repeater_slider";a:0:{}s:17:"repeater_carousel";a:0:{}s:20:"repeater_testimonial";a:0:{}s:25:"hashone_disable_about_sec";s:2:"on";s:22:"hashone_featured_title";s:28:"¿Qué es el Pacto de Honor?";s:21:"hashone_featured_desc";s:834:"Es un compromiso contigo, es un pacto que firmas de corazón y con el cual aportas a nuestro objetivo de celebrar los buenos comportamientos de los miembros de la familia grancolombiana.\n\nQueremos que sepas que desde el primer día en que llegas a la Institución, nosotros asumimos el compromiso de guiarte en tu proyecto profesional y de vida y por ello, incentivamos las buenas actitudes, porque te facilitarán la toma de decisiones responsable y autónoma por el resto de tu vida.\n\nEn ese sentido, es a través de este pacto de honor que expresamos nuestro rechazo hacia las conductas anti éticas y que se alejan de los valores grancolombianos, como el respeto, la tolerancia y principalmente la HONESTIDAD.\nEs por ello que nos declaramos enemigos del fraude, el plagio y la suplantación y es hora de que tú también lo hagas.";s:21:"hashone_portfolio_cat";s:0:"";s:23:"hashone_service_left_bg";s:103:"http://localhost:8888/wp-content/uploads/2017/02/Captura-de-pantalla-2017-02-10-a-las-10.16.29-p.m..png";s:21:"hashone_service_title";s:14:"PACTO DE HONOR";s:25:"hashone_service_sub_title";s:38:"Nuestro proyecto de Práctica Aplicada";s:18:"hashone_team_title";s:13:"Nuestro Grupo";s:22:"hashone_team_sub_title";s:575:"WILLIAM ROBERT TAUTIVA PRADERE\nRICARDO ANDRES ZAMBRANO CUAICUAN\nMANUEL FERNANDO SANCHEZ ACEVEDO\nNICOLAS MARTINEZ MARIN\nCAMILA ANDREA GUTIÉRREZ LESMES\nJUAN GUILLERMO CELEMIN MARTINEZ\nJAIR DARIO MUÑOZ AGUILAR\nSTEVEN ALEXANDER LAGOS LAGOS\nIVAN DAVID BARRANTES BARRANTES\nJUAN NICOLAS RUBIANO OBANDO\nWILMER RICARDO CASTRO DELGADILLO\nJULIO ERNESTO RODRIGUEZ RINCON\nEDNA LIZETH ESPEJO OSMA\nCAMILO ARTURO D''ACHIARDI LEÓN\nJEIMY ROCIO SOSA GOMEZ\nGABRIEL SANTIAGO aLVAREZ AMAYA\nJUAN CAMILO LANCHEROS DUQUE\nDIEGO IVAN OLIVEROS ACOSTA\nJAIME DAVID BERNAL VILLARRAGA\nDAVID YEPES BUITRAGO";s:21:"hashone_counter_title";s:29:"Características del Proyecto";s:25:"hashone_counter_sub_title";s:0:"";s:18:"hashone_counter_bg";s:0:"";s:27:"hashone_disable_counter_sec";s:2:"on";s:22:"hashone_counter_title1";s:41:"Deben estar los personajes de la campaña";s:24:"hashone_disable_logo_sec";s:2:"on";s:25:"hashone_testimonial_title";s:29:"Características del Proyecto";s:29:"hashone_testimonial_sub_title";s:92:"- Deben estar todos los personajes de la campaña. - Libertad del comportamiento en el juego";s:24:"hashone_disable_blog_sec";s:2:"on";s:27:"hashone_disable_contact_sec";s:2:"on";s:25:"hashone_team_designation1";s:3:"CEO";s:18:"hashone_logo_title";s:0:"";s:22:"hashone_logo_sub_title";s:0:"";s:27:"hashone_featured_page_icon3";s:10:"fa fa-star";s:23:"hashone_portfolio_title";s:16:"Características";s:16:"sidebars_widgets";a:2:{s:4:"time";i:1486786779;s:4:"data";a:2:{s:19:"wp_inactive_widgets";a:0:{}s:18:"orphaned_widgets_1";a:6:{i:0;s:8:"search-2";i:1;s:14:"recent-posts-2";i:2;s:17:"recent-comments-2";i:3;s:10:"archives-2";i:4;s:12:"categories-2";i:5;s:6:"meta-2";}}}}', 'yes'),
