(80, 38, '_panels_data_preview', 'a:3:{s:7:"widgets";a:14:{i:0;a:5:{s:4:"type";s:6:"visual";s:5:"title";s:8:"Objetivo";s:4:"text";s:137:"<p>Programar un divertido videojuego para promover el buen uso de la información, dentro y fuera de las instalaciones universitarias</p>";s:6:"filter";s:1:"1";s:11:"panels_info";a:7:{s:5:"class";s:30:"WP_Widget_Black_Studio_TinyMCE";s:3:"raw";b:0;s:4:"grid";i:0;s:4:"cell";i:0;s:2:"id";i:0;s:9:"widget_id";s:36:"9370cc25-fa3d-4310-b22f-ea21b9797d3f";s:5:"style";a:1:{s:18:"background_display";s:4:"tile";}}}i:1;a:5:{s:4:"type";s:6:"visual";s:5:"title";s:16:"Características";s:4:"text";s:226:"<ul><li>Promueve el aprendizaje sano en la universidad y vida profesional.</li><li>Juego gratuito para toda la comunidad universitaria.</li><li>Llegar a toda la comunidad estudiantil de educación superior del país.</li></ul>";s:6:"filter";s:1:"1";s:11:"panels_info";a:7:{s:5:"class";s:30:"WP_Widget_Black_Studio_TinyMCE";s:3:"raw";b:0;s:4:"grid";i:0;s:4:"cell";i:1;s:2:"id";i:1;s:9:"widget_id";s:36:"bc1e0a42-92ed-4887-bee9-19ac9cd6f71a";s:5:"style";a:1:{s:18:"background_display";s:4:"tile";}}}i:2;a:13:{s:5:"image";i:114;s:14:"image_fallback";s:0:"";s:4:"size";s:4:"full";s:5:"align";s:6:"center";s:5:"title";s:0:"";s:14:"title_position";s:6:"hidden";s:3:"alt";s:0:"";s:3:"url";s:0:"";s:5:"bound";b:1;s:12:"_sow_form_id";s:13:"58decf59bf50e";s:10:"new_window";b:0;s:10:"full_width";b:0;s:11:"panels_info";a:7:{s:5:"class";s:30:"SiteOrigin_Widget_Image_Widget";s:3:"raw";b:0;s:4:"grid";i:1;s:4:"cell";i:0;s:2:"id";i:2;s:9:"widget_id";s:36:"26487667-0fbb-4649-b018-2feb86290950";s:5:"style";a:1:{s:18:"background_display";s:4:"tile";}}}i:3;a:5:{s:4:"type";s:6:"visual";s:5:"title";s:0:"";s:4:"text";s:1462:"<h2 class="mg-md  text-left"> </h2><h2 class="mg-md  text-left"><span style="color: #ffffff;">Objetivo del Proyecto</span></h2><p class=" text-left"><span style="color: #ffffff;">Desarrollar un juego con el fin de promover el buen uso de la información que no nos pertenece, usar sus respectivas referencias con sus derechos de autor para mejorar el comportamiento ético como moral del estudiante universitario. </span><br /><br /></p><h2 class="mg-md"><span style="color: #ffffff;">Historia del Juego</span></h2><p><span style="color: #ffffff;">La villa del Poli, una población próspera donde todos sus habitantes eran ejemplos para la sociedad, fue atacada a principios del siglo XXI, por la villa de Chitedosrra, donde vivían personas muy malas llenas de avaricia, pereza y deshonestidad. El combate entre las dos villas se prolongó por mucho tiempo, cuando esta guerra terminó la villa del Poli, quedó infectada por las malas costumbres de los Chitedorrences y algunos de ellos estaban infiltrados en la villa. Después de un tiempo de tranquilidad los chitedorrences infiltrados atacaron a la villa del Poli y tomaron posesión de sus 12 mundos y sus 60 niveles, haciendo esclavos a los habitantes no infectados de la villa. Su objetivo como antiguo habitante de la villa del Poli es desbloquear todos los personajes, ganar cada nivele de los 12 mundos y devolverles la tranquilidad a todos los habitantes de la villa.</span></p><p> </p><p> </p>";s:6:"filter";s:1:"1";s:11:"panels_info";a:7:{s:5:"class";s:30:"WP_Widget_Black_Studio_TinyMCE";s:3:"raw";b:0;s:4:"grid";i:2;s:4:"cell";i:0;s:2:"id";i:3;s:9:"widget_id";s:36:"4e9146cd-b8b3-456c-975e-7e7b472d52b0";s:5:"style";a:1:{s:18:"background_display";s:4:"tile";}}}i:4;a:5:{s:4:"type";s:6:"visual";s:5:"title";s:0:"";s:4:"text";s:577:"<p style="text-align: center;"> </p><p style="text-align: center;"> </p><p style="text-align: center;"><span style="color: #c9c9c9;"><img class="aligncenter wp-image-195 " src="http://localhost:8888/wp-content/uploads/2017/04/Logo-App-SYMBOL.png" alt="" width="395" height="395" /></span></p><p style="text-align: center;"><span style="color: #c9c9c9;">El proyecto se realizará en una plataforma web en donde se encontrará el juego gratuito para enfrentar el reto en dispositivos móviles y de escritorio con el fin de llegar más allá de la comunidad del Poli.</span></p>";s:6:"filter";s:1:"1";s:11:"panels_info";a:6:{s:5:"class";s:30:"WP_Widget_Black_Studio_TinyMCE";s:4:"grid";i:2;s:4:"cell";i:1;s:2:"id";i:4;s:9:"widget_id";s:36:"f0b841bf-cc6b-47db-8fb6-3717163275ed";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}}i:5;a:5:{s:4:"type";s:6:"visual";s:5:"title";s:0:"";s:4:"text";s:285:"<h2 style="text-align: center;">Estructura de Entregables</h2><p style="text-align: center;"><img class="alignnone wp-image-84 size-full" src="http://localhost:8888/wp-content/uploads/2017/02/Captura-de-pantalla-2017-02-11-a-las-1.05.45-a.m..png" alt="" width="989" height="364" /></p>";s:6:"filter";s:1:"1";s:11:"panels_info";a:7:{s:5:"class";s:30:"WP_Widget_Black_Studio_TinyMCE";s:3:"raw";b:0;s:4:"grid";i:3;s:4:"cell";i:0;s:2:"id";i:5;s:9:"widget_id";s:36:"bec8e65d-2271-4986-b863-b95de0107858";s:5:"style";a:1:{s:18:"background_display";s:4:"tile";}}}i:6;a:5:{s:4:"type";s:6:"visual";s:5:"title";s:0:"";s:4:"text";s:244:"<h2 style="text-align: center;">Módulos</h2><p><img class="aligncenter wp-image-92 size-full" src="http://localhost:8888/wp-content/uploads/2017/02/Captura-de-pantalla-2017-02-12-a-las-11.15.30-p.m..png" alt="" width="1246" height="724" /></p>";s:6:"filter";s:1:"1";s:11:"panels_info";a:7:{s:5:"class";s:30:"WP_Widget_Black_Studio_TinyMCE";s:3:"raw";b:0;s:4:"grid";i:3;s:4:"cell";i:1;s:2:"id";i:6;s:9:"widget_id";s:36:"5ac2c7a5-cbc8-4781-a1c9-0f0923908b3c";s:5:"style";a:1:{s:18:"background_display";s:4:"tile";}}}i:7;a:5:{s:4:"type";s:6:"visual";s:5:"title";s:0:"";s:4:"text";s:336:"<h2 style="text-align: center;">Juego</h2><p style="text-align: center;">App móvil en Play Store y juego también disponible en Facebook Games</p><p style="text-align: center;"><img class="aligncenter wp-image-105 size-full" src="http://localhost:8888/wp-content/uploads/2017/03/mockup-web.png" alt="" width="1764" height="1072" 