:"default";s:5:"title";s:0:"";s:14:"title_position";s:6:"hidden";s:3:"alt";s:0:"";s:3:"url";s:0:"";s:5:"bound";b:1;s:10:"full_width";b:1;s:12:"_sow_form_id";s:13:"58ded557c5232";s:10:"new_window";b:0;s:11:"panels_info";a:7:{s:5:"class";s:30:"SiteOrigin_Widget_Image_Widget";s:3:"raw";b:0;s:4:"grid";i:6;s:4:"cell";i:1;s:2:"id";i:11;s:9:"widget_id";s:36:"c0505ff4-1a51-45f0-8921-b0a6dcf94910";s:5:"style";a:1:{s:18:"background_display";s:4:"tile";}}}i:12;a:13:{s:5:"image";i:106;s:14:"image_fallback";s:0:"";s:4:"size";s:4:"full";s:5:"align";s:5:"right";s:5:"title";s:0:"";s:14:"title_position";s:6:"hidden";s:3:"alt";s:0:"";s:3:"url";s:0:"";s:5:"bound";b:1;s:10:"full_width";b:1;s:12:"_sow_form_id";s:13:"58ded600141cf";s:10:"new_window";b:0;s:11:"panels_info";a:7:{s:5:"class";s:30:"SiteOrigin_Widget_Image_Widget";s:3:"raw";b:0;s:4:"grid";i:7;s:4:"cell";i:0;s:2:"id";i:12;s:9:"widget_id";s:36:"da7d0475-fbc9-446e-9a3d-434fc5d61407";s:5:"style";a:1:{s:18:"background_display";s:4:"tile";}}}i:13;a:5:{s:4:"type";s:6:"visual";s:5:"title";s:0:"";s:4:"text";s:1079:"<h2><span style="color: #808080;">¿Qué es el Pacto de Honor?</span></h2><p><span style="color: #808080;">Es un compromiso contigo, es un pacto que firmas de corazón y con el cual aportas a nuestro objetivo de celebrar los buenos comportamientos de los miembros de la familia grancolombiana.</span></p><p><span style="color: #808080;">Queremos que sepas que desde el primer día en que llegas a la Institución, nosotros asumimos el compromiso de guiarte en tu proyecto profesional y de vida y por ello, incentivamos las buenas actitudes, porque te facilitarán la toma de decisiones responsable y autónoma por el resto de tu vida.</span></p><p><span style="color: #808080;">En ese sentido, es a través de este pacto de honor que expresamos nuestro rechazo hacia las conductas anti éticas y que se alejan de los valores grancolombianos, como el respeto, la tolerancia y principalmente la HONESTIDAD.</span></p><p><span style="color: #808080;">Es por ello que nos declaramos enemigos del fraude, el plagio y la suplantación y es hora de que tú también lo hagas.</span></p>";s:6:"filter";s:1:"1";s:11:"panels_info";a:7:{s:5:"class";s:30:"WP_Widget_Black_Studio_TinyMCE";s:3:"raw";b:0;s:4:"grid";i:7;s:4:"cell";i:1;s:2:"id";i:13;s:9:"widget_id";s:36:"317979ba-82c7-4a59-8082-655024c430d2";s:5:"style";a:1:{s:18:"background_display";s:4:"tile";}}}}s:5:"grids";a:8:{i:0;a:2:{s:5:"cells";i:2;s:5:"style";a:0:{}}i:1;a:2:{s:5:"cells";i:1;s:5:"style";a:0:{}}i:2;a:2:{s:5:"cells";i:2;s:5:"style";a:3:{s:11:"row_stretch";s:4:"full";s:27:"background_image_attachment";i:83;s:18:"background_display";s:8:"parallax";}}i:3;a:2:{s:5:"cells";i:2;s:5:"style";a:0:{}}i:4;a:2:{s:5:"cells";i:1;s:5:"style";a:1:{s:18:"background_display";s:4:"tile";}}i:5;a:2:{s:5:"cells";i:2;s:5:"style";a:6:{s:13:"bottom_margin";s:3:"0px";s:6:"gutter";s:3:"0px";s:7:"padding";s:15:"0px 0px 0px 0px";s:14:"mobile_padding";s:15:"0px 0px 0px 0px";s:11:"row_stretch";s:14:"full-stretched";s:18:"background_display";s:4:"tile";}}i:6;a:2:{s:5:"cells";i:2;s:5:"style";a:6:{s:13:"bottom_margin";s:3:"0px";s:6:"gutter";s:3:"0px";s:7:"padding";s:15:"0px 0px 0px 0px";s:14:"mobile_padding";s:15:"0px 0px 0px 0px";s:11:"row_stretch";s:14:"full-stretched";s:18:"background_display";s:4:"tile";}}i:7;a:2:{s:5:"cells";i:2;s:5:"style";a:2:{s:11:"row_stretch";s:14:"full-stretched";s:18:"background_display";s:4:"tile";}}}s:10:"grid_cells";a:14:{i:0;a:2:{s:4:"grid";i:0;s:6:"weight";d:0.5;}i:1;a:2:{s:4:"grid";i:0;s:6:"weight";d:0.5;}i:2;a:2:{s:4:"grid";i:1;s:6:"weight";i:1;}i:3;a:2:{s:4:"grid";i:2;s:6:"weight";d:0.5;}i:4;a:2:{s:4:"grid";i:2;s:6:"weight";d:0.5;}i:5;a:2:{s:4:"grid";i:3;s:6:"weight";d:0.5;}i:6;a:2:{s:4:"grid";i:3;s:6:"weight";d:0.5;}i:7;a:2:{s:4:"grid";i:4;s:6:"weight";i:1;}i:8;a:2:{s:4:"grid";i:5;s:6:"weight";d:0.5;}i:9;a:2:{s:4:"grid";i:5;s:6:"weight";d:0.5;}i:10;a:2:{s:4:"grid";i:6;s:6:"weight";d:0.5;}i:11;a:2:{s:4:"grid";i:6;s:6:"weight";d:0.5;}i:12;a:2:{s:4:"grid";i: