(282, 77, 'panels_data', 'a:3:{s:7:"widgets";a:3:{i:0;a:5:{s:4:"type";s:6:"visual";s:5:"title";s:19:"¿Qué es el Pacto?";s:4:"text";s:835:"Es un compromiso contigo, es un pacto que firmas de corazón y con el cual aportas a nuestro objetivo de celebrar los buenos comportamientos de los miembros de la familia grancolombiana.\n\nQueremos que sepas que desde el primer día en que llegas a la Institución, nosotros asumimos el compromiso de guiarte en tu proyecto profesional y de vida y por ello, incentivamos las buenas actitudes, porque te facilitarán la toma de decisiones responsable y autónoma por el resto de tu vida.\n\nEn ese sentido, es a través de este pacto de honor que expresamos nuestro rechazo hacia las conductas anti éticas y que se alejan de los valores grancolombianos, como el respeto, la tolerancia y principalmente la HONESTIDAD.\n\nEs por ello que nos declaramos enemigos del fraude, el plagio y la suplantación y es hora de que tú también lo hagas.";s:6:"filter";s:1:"1";s:11:"panels_info";a:6:{s:5:"class";s:30:"WP_Widget_Black_Studio_TinyMCE";s:4:"grid";i:0;s:4:"cell";i:0;s:2:"id";i:0;s:9:"widget_id";s:36:"11d92a9c-07fc-447d-895b-edd0cc657f66";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}}i:1;a:5:{s:4:"type";s:6:"visual";s:5:"title";s:16:"Características";s:4:"text";s:89:"-  Deben estar los personajes de la campaña.\n-  Libertad del comportamiento en el juego.";s:6:"filter";s:1:"1";s:11:"panels_info";a:6:{s:5:"class";s:30:"WP_Widget_Black_Studio_TinyMCE";s:4:"grid";i:1;s:4:"cell";i:0;s:2:"id";i:1;s:9:"widget_id";s:36:"f13eed4a-8df4-42fa-b741-6162f586c618";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}}i:2;a:5:{s:4:"type";s:6:"visual";s:5:"title";s:0:"";s:4:"text";s:0:"";s:6:"filter";s:1:"1";s:11:"panels_info";a:6:{s:5:"class";s:30:"WP_Widget_Black_Studio_TinyMCE";s:4:"grid";i:1;s:4:"cell";i:1;s:2:"id";i:2;s:9:"widget_id";s:36:"40b95e81-0cbd-41da-901c-519b2265ad9