osition";s:6:"hidden";s:3:"alt";s:0:"";s:3:"url";s:0:"";s:5:"bound";b:1;s:10:"full_width";b:1;s:12:"_sow_form_id";s:13:"58dee15e8a3cb";s:11:"panels_info";a:6:{s:5:"class";s:30:"SiteOrigin_Widget_Image_Widget";s:4:"grid";i:6;s:4:"cell";i:0;s:2:"id";i:24;s:9:"widget_id";s:36:"69b4be90-003e-496f-96bd-23e90dae65bf";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}s:10:"new_window";b:0;}i:25;a:5:{s:4:"type";s:6:"visual";s:5:"title";s:0:"";s:4:"text";s:513:"<h2>Fabián Babuino</h2><p><strong>Descripción:</strong> Es una persona temperamental, de malgenio, sociable únicamente con su grupo de amigos, conflictiva para ganar territorio y reconocimiento.Su habilidad se caracteriza por su gran fuerza al momento de atacar y excelente defensa.</p><p><strong>Personalidad:</strong> Es una persona explosiva, fuerte en sus contestaciones, bastante volátil y conflictivo. Tiene malas amistades que influyen su vida de manera completa.Bastante territorial y competitivo.</p>";s:6:"filter";s:1:"1";s:11:"panels_info";a:6:{s:5:"class";s:30:"WP_Widget_Black_Studio_TinyMCE";s:4:"grid";i:6;s:4:"cell";i:0;s:2:"id";i:25;s:9:"widget_id";s:36:"3717e3ff-4422-4e1e-a477-358de7c469b0";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}}i:26;a:13:{s:5:"image";i:140;s:14:"image_fallback";s:0:"";s:4:"size";s:4:"full";s:5:"align";s:7:"default";s:5:"title";s:0:"";s:14:"title_position";s:6:"hidden";s:3:"alt";s:0:"";s:3:"url";s:0:"";s:5:"bound";b:1;s:10:"full_width";b:1;s:12:"_sow_form_id";s:13:"58dee1936bacf";s:11:"panels_info";a:6:{s:5:"class";s:30:"SiteOrigin_Widget_Image_Widget";s:4:"grid";i:6;s:4:"cell";i:1;s:2:"id";i:26;s:9:"widget_id";s:36:"e5a8901f-ab98-4ac5-a9d4-56bcc03a4470";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}s:10:"new_window";b:0;}i:27;a:5:{s:4:"type";s:6:"visual";s:5:"title";s:0:"";s:4:"text";s:638:"<h3>Victor Hiena</h3><p><strong>Descripción:</strong> Es una persona tranquila, fría, viste muy bien, sin preocupaciones, pero NO es totalmente feliz ya que habla mal de las demás personas.Su habilidad especial se manifiesta al hablar generando un veneno mortal para los oponentes de cualquier clase, por lo tanto, no socializa con nadie, sin embargo, por intuición cree que puede observar las personas.</p><p><strong>Personalidad:</strong> Es una persona fría, eficaz, con un potente veneno en sus colmillos, excelente agilidad, nada de socialización con las personas, buen trabajo grupal pero un nivel de hipocresía superior.</p>";s:6:"filter";s:1:"1";s:11:"panels_info";a:6:{s:5:"class";s:30:"WP_Widget_Black_Studio_TinyMCE";s:4:"grid";i:6;s:4:"cell";i:1;s:2:"id";i:27;s:9:"widget_id";s:36:"0220c26a-9c4d-4e1b-a7b2-b4386a600db7";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}}i:28;a:13:{s:5:"image";i:139;s:14:"image_fallback";s:0:"";s:4:"size";s:4:"full";s:5:"align";s:7:"default";s:5:"title";s:0:"";s:14:"title_position";s:6:"hidden";s:3:"alt";s:0:"";s:3:"url";s:0:"";s:5:"bound";b:1;s:10:"full_width";b:1;s:12:"_sow_form_id";s:13:"58dee19acd723";s:11:"panels_info";a:6:{s:5:"class";s:30:"SiteOrigin_Widget_Image_Widget";s:4:"grid";i:6;s:4:"cell";i:2;s:2:"id";i:28;s:9:"widget_id";s:36:"242e87fe-1bce-415e-9fd6-009a8f4a6637";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}s:10:"new_window";b:0;}i:29;a:5:{s:4:"type";s:6:"visual";s:5:"title";s:0:"";s:4:"text";s:634:"<h3>Nicolás Lagarto</h3><p><strong>Descripción:</strong> Es una persona alegre, perezoso, y deportista. Bastante competitivo y cuenta con unas orejas pequeñas que permiten escuchar a más distancia de lo habitual.</p><p><strong>Personalidad:</strong> Es una persona alegre, inteligente y sociable.Actualmente es un nadador profesional, pero no distribuye correctamente sus espacios y siempre pide ayuda a sus amigos la inclusión de su nombre en trabajos estudiantiles o resúmenes laborales.Su habilidad le permite cambiar de grupo según quien vaya ganando, pero tiene efectos negativos sobre los puntos del grupo en general.</p>";s:6:"filter";s:1:"1";s:11:"panels_info";a:6:{s:5:"class";s:30:"WP_Widget_Black_Studio_TinyMCE";s:4:"grid";i:6;s:4:"cell";i:2;s:2:"id";i:29;s:9:"widget_id";s:36:"a4912da4-3602-45da-a301-811d01dc5faa";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}}i:30;a:13:{s:5:"image";i:138;s:14:"image_fallback";s:0:"";s:4:"size";s:4:"full";s:5:"align";s:7:"default";s:5:"title";s:0:"";s:14:"title_position";s:6:"hidden";s:3:"alt";s:0:"";s:3:"url";s:0:"";s:5:"bound";b:1;s:10:"full_width";b:1;s:12:"_sow_form_id";s:13:"58dee1e8831d1";s:11:"panels_info";a:6:{s:5:"class";s:30:"SiteOrigin_Widget_Image_Widget";s:4:"grid";i:7;s:4:"cell";i:0;s:2:"id";i:30;s:9:"widget_id";s:36:"146d4a3b-629f-408b-8ff7-d3c5bd91342f";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}s:10:"new_window";b:0;}i:31;a:5:{s:4:"type";s:6:"visual";s:5:"title";s:0:"";s:4:"text";s:655:"<h3>Julián Burro</h3><p><strong>Descripción:</strong> Una persona de estrato medio, que intenta obtener logros para su beneficio a costa de los demás. Es conocido por contratar terceros para hacer sus trabajos y parciales estudiantiles, avances laborales y proyectos.Su habilidad es conseguir equipamiento sin necesidad de gemas ni códigos.</p><p><strong>Personalidad:</strong> Es una persona chistosa, facilista, y mentirosa. Habla más de la cuenta sobre sus trabajos, para demostrar que realizo con sus propias manos lo solicitado a los terceros. Le encanta festejar los engaños a docentes en la universidad y jefes en la empresa donde labora.</p>";s:6:"filter";s:1:"1";s:11:"panels_info";a:6:{s:5:"class";s:30:"WP_Widget_Black_Studio_TinyMCE";s:4:"grid";i:7;s:4:"cell";i:0;s:2:"id";i:31;s:9:"widget_id";s:36:"f079447b-efc1-47c6-8605-76cbf653d4e5";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"backgrou