chment";b:0;s:18:"background_display";s:4:"tile";}}s:10:"new_window";b:0;}i:35;a:5:{s:4:"type";s:6:"visual";s:5:"title";s:0:"";s:4:"text";s:619:"<h3>Juan Camaleón</h3><p><strong>Descripción:</strong> Es una persona inteligente, cumplida al momento de entregar los temas pendientes a su cargo, buen compañero, poco sociable, pero en busca de ser aceptado por las personas.En busca de ser aceptado suplanta a sus amigos en los parciales o trabajos.Su habilidad especial es realizar ataques sorpresa con invisibilidad.</p><p><strong>Personalidad:</strong> Es una persona comprometida con sus deberes, reflejando buenos valores y poco conflictivo. Sin embargo, depende de la opinión de los demás para tomar alguna decisión laboral, estudiantil o sentimental.</p>";s:6:"filter";s:1:"1";s:11:"panels_info";a:6:{s:5:"class";s:30:"WP_Widget_Black_Studio_TinyMCE";s:4:"grid";i:7;s:4:"cell";i:2;s:2:"id";i:35;s:9:"widget_id";s:36:"c020123a-8ea2-451c-810c-f6bc92f302b3";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}}i:36;a:13:{s:5:"image";i:135;s:14:"image_fallback";s:0:"";s:4:"size";s:4:"full";s:5:"align";s:7:"default";s:5:"title";s:0:"";s:14:"title_position";s:6:"hidden";s:3:"alt";s:0:"";s:3:"url";s:0:"";s:5:"bound";b:1;s:10:"full_width";b:1;s:12:"_sow_form_id";s:13:"58dee6a09f45a";s:11:"panels_info";a:6:{s:5:"class";s:30:"SiteOrigin_Widget_Image_Widget";s:4:"grid";i:8;s:4:"cell";i:0;s:2:"id";i:36;s:9:"widget_id";s:36:"0623e4bc-2fb8-48f6-84bc-dc0e640e7dac";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}s:10:"new_window";b:0;}i:37;a:5:{s:4:"type";s:6:"visual";s:5:"title";s:0:"";s:4:"text";s:692:"<h3>Carlos Buitre</h3><p><strong>Descripción:</strong> Es una persona perspicaz, aparenta una vida correcta y realizada, pero en el fondo existe una persona engañosa y estafadora. Su habilidad principal es falsificar documentos para escabullirse de cualquier evento que pueda afectar su imagen y sobre todo sus planes. Utiliza razones falsas para derrotar a sus oponentes.</p><p><strong>Personalidad:</strong> Es una persona con actitud amable y de servicio, hace muchos amigos para después engañar y aprovecharse de las situaciones que lo benefician. Poco después de sus cometidos, desaparece sin dejar rastro. Conserva una excelente vista, para cazar a sus oponentes más ingenuos.</p>";s:6:"filter";s:1:"1";s:11:"panels_info";a:6:{s:5:"class";s:30:"WP_Widget_Black_Studio_TinyMCE";s:4:"grid";i:8;s:4:"cell";i:0;s:2:"id";i:37;s:9:"widget_id";s:36:"965ad599-d12c-4caf-badf-ef7fde9ebc79";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}}i:38;a:13:{s:5:"image";i:134;s:14:"image_fallback";s:0:"";s:4:"size";s:4:"full";s:5:"align";s:7:"default";s:5:"title";s:0:"";s:14:"title_position";s:6:"hidden";s:3:"alt";s:0:"";s:3:"url";s:0:"";s:5:"bound";b:1;s:10:"full_width";b:1;s:12:"_sow_form_id";s:13:"58dee6adb2c62";s:11:"panels_info";a:6:{s:5:"class";s:30:"SiteOrigin_Widget_Image_Widget";s:4:"grid";i:8;s:4:"cell";i:1;s:2:"id";i:38;s:9:"widget_id";s:36:"475c2947-0662-48ab-92d4-e3134a452337";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}s:10:"new_window";b:0;}i:39;a:5:{s:4:"type";s:6:"visual";s:5:"title";s:0:"";s:4:"text";s:516:"<h3>Felipe Oso</h3><p><strong>Descripción:</strong> Es una persona que viste muy formal, pero no debes confiar en su apariencia. Es conocido por no sonreír, por su indisposición ante las situaciones y especialista en copiar movimientos, poderes y gestos.Intuitivamente puede obtener los poderes de sus compañeros o enemigos para su beneficio propio.</p><p><strong>Personalidad:</strong> Es una persona que en un mundo de fraude se siente triste, desanimo, pierde el brillo en sus ojos, cabizbajo y frustrado.</p>";s:6:"filter";s:1:"1";s:11:"panels_info";a:6:{s:5:"class";s:30:"WP_Widget_Black_Studio_TinyMCE";s:4:"grid";i:8;s:4:"cell";i:1;s:2:"id";i:39;s:9:"widget_id";s:36:"cd8ec287-ef3b-49eb-8a16-8ea2b5094d45";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}}i:40;a:13:{s:5:"image";i:133;s:14:"image_fallback";s:0:"";s:4:"size";s:4:"full";s:5:"align";s:7:"default";s:5:"title";s:0:"";s:14:"title_position";s:6:"hidden";s:3:"alt";s:0:"";s:3:"url";s:0:"";s:5:"bound";b:1;s:10:"full_width";b:1;s:12:"_sow_form_id";s:13:"58dee6b68a3b3";s:11:"panels_info";a:6:{s:5:"class";s:30:"SiteOrigin_Widget_Image_Widget";s:4:"grid";i:8;s:4:"cell";i:2;s:2:"id";i:40;s:9:"widget_id";s:36:"f696f9bd-2c78-4526-8256-d0a357de221c";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}s:10:"new_window";b:0;}i:41;a:5:{s:4:"type";s:6:"visual";s:5:"title";s:0:"";s:4:"text";s:693:"<h3>Camilo Perezoso</h3><p><strong>Descripción:</strong> Casual, al mantener una de sus manos en el bolsillo, indica la falta de compromiso con el estudio y sobre todo el poco interés para tomar decisiones en cualquier ámbito de su vida.Sus ojos bien abiertos, pero con mente distraída y síntomas de cansancio por falta de sueño, debido a sus frecuentes salidas nocturnas. Aparece al final de la batalla con un poderoso ataque.</p><p><strong>Personalidad:</strong> Antes de evidenciar la falta de asistencia y el poco interés por las clases Camilo Perezoso tiene un habitual problema para tomar decisiones y pierde el interés rápidamente por las cosas. Es una persona competitiva.</p>";s:6:"filter";s:1:"1";s:11:"panels_info";a:6:{s:5:"class";s:30:"WP_Widget_Black_Studio_TinyMCE";s:4:"grid";i:8;s:4:"cell";i:2;s:2:"id";i:41;s:9:"widget_id";s:36:"6d81934c-b15a-4082-8061-071c5c160dc2";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}}i:42;a:13:{s:5:"image";i:132;s:14:"image_fallback";s:0:"";s:4:"size";s:4:"full";s:5:"align";s:7:"default";s:5:"title";s:0:"";s:14:"title_position";s:6:"hidden";s:3:"alt";s:0:"";s:3:"url";s:0:"";s:5:"bound";b:1;s:10:"full_width";b:1;s:12:"_sow_form_id";s:13:"58dee6c1dc6cf";s:11:"panels_info";a:6:{s:5:"class";s:30:"SiteOrigin_Widget_Image_Widget";s:4:"grid";i:9;s:4:"cell";i:0;s:2:"id";i:42;s:9:"widget_id";s:36:"45d33395-67e9-44fe-9d38-e9569865721d";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}s:10:"new_window";b:0;}i:43;a:5:{s:4:"type";s:6:"visual";s:5:"title";s:0:"";s:4:"text";s:478:"<h3>Ana y Sara Abeja</h3><p><strong>Descripción:</strong> Son realmente hermosas, les encanta salir a reunirse con sus amigos a compartir, participan poco a clase y sus prioridades siempre son las fiestas y sus amigos que el estudio. Son bastante reconocidas por ser descubiertas realizando fraude en un examen.</p><p><strong>Personalidad:</strong> Ellas son físicamente hermosas, sociables, perezosas, de poco interés por el estudio y les encantan las sesiones de fotos.</p>";s:6:"filter";s:1:"1";s:11:"panels_info";a:6:{s:5:"class";s:30:"WP_Widget_Black_Studio_TinyMCE";s:4:"grid";i:9;s:4:"cell";i:0;s:2:"id";i:43;s:9:"widget_id";s:36:"48f18db1-fce5-45a6-a406-c165273302d4";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}}i:44;a:13:{s:5:"image";i:131;s:14:"image_fallback";s:0:"";s:4:"size";s:4:"full";s:5:"align";s:7:"default";s:5:"title";s:0:"";s:14:"title_position";s:6:"hidden";s:3:"alt";s:0:"";s:3:"url";s:0:"";s:5:"bound";b:1;s:10:"full_width";b:1;s:12:"_sow_form_id";s:13:"58dee6cc5c630";s:11:"panels_info";a:6:{s:5:"class";s:30:"SiteOrigin_Widget_Image_Widget";s:4:"grid";i:9;s:4:"cell";i:1;s:2:"id";i:44;s:9:"widget_id";s:36:"ef78bd67-8024-45c4-b18c-f4131968043a";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}s:10:"new_window";b:0;}i:45;a:5:{s:4:"type";s:6:"visual";s:5:"title";s:0:"";s:4:"text";s:595:"<h3>Andrés Zorro</h3><p><strong>Descripción:</strong> Es una persona joven, compañerita y de muy buen ambiente. Sin embargo, se ha visto preocupado e inestable emocionalmente por la serie de evidencias que lo involucran en colarse en sistemas de transporte universitario. Su habilidad tiene como finalidad saltar turnos de batalla para su beneficio.</p><p><strong>Personalidad:</strong> Joven extrovertido, amigable, reconocido en su entorno por ser practicante Parkour. Dicho reconocimiento en público desato un comportamiento extraño y repentino en los paraderos de servicio público.</p>";s:6:"filter";s:1:"1";s:11:"panels_info";a:6:{s:5:"class";s:30:"WP_Widget_Black_Studio_TinyMCE";s:4:"grid";i:9;s:4:"cell";i:1;s:2:"id";i:45;s:9:"widget_id";s:36:"5f477ab5-9bd6-47af-b9a3-1d0392a623eb";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}}i:46;a:13:{s:5:"image";i:130;s:14:"image_fallback";s:0:"";s:4:"size";s:4:"full";s:5:"align";s:7:"default";s:5:"title";s:0:"";s:14:"title_position";s:6:"hidden";s:3:"alt";s:0:"";s:3:"url";s:0:"";s:5:"bound";b:1;s:10:"full_width";b:1;s:12:"_sow_form_id";s:13:"58dee6d8bd802";s:11:"panels_info";a:6:{s:5:"class";s:30:"SiteOrigin_Widget_Image_Widget";s:4:"grid";i:9;s:4:"cell";i:2;s:2:"id";i:46;s:9:"widget_id";s:36:"6279a5fe-2f7a-428a-a7f9-49c943487089";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}s:10:"new_window";b:0;}i:47;a:5:{s:4:"type";s:6:"visual";s:5:"title";s:0:"";s:4:"text";s:529:"<h3>Juan Rata</h3><p><strong>Descripción:</strong> Es una persona que vive en un mundo fraudulento. Se provee de artículos importantes realizar distribuciones a cambio de dinero.Su habilidad principal es quitar parte del equipamiento del oponente únicamente al tocarlo.</p><p><strong>Personalidad:</strong> Es una persona ágil al momento de conseguir información, le encanta el dinero fácil, cuenta con varios contactos que ayudan con la recolección de la información para distribuir posteriormente a los compradores.</p>";s:6:"filter";s:1:"1";s:11:"panels_info";a:6:{s:5:"class";s:30:"WP_Widget_Black_Studio_TinyMCE";s:4:"grid";i:9;s:4:"cell";i:2;s:2:"id";i:47;s:9:"widget_