:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}}i:3;a:13:{s:5:"image";i:123;s:14:"image_fallback";s:0:"";s:4:"size";s:4:"full";s:5:"align";s:7:"default";s:5:"title";s:0:"";s:14:"title_position";s:6:"hidden";s:3:"alt";s:0:"";s:3:"url";s:0:"";s:5:"bound";b:1;s:10:"full_width";b:1;s:12:"_sow_form_id";s:13:"58dedfaf2e157";s:11:"panels_info";a:6:{s:5:"class";s:30:"SiteOrigin_Widget_Image_Widget";s:4:"grid";i:1;s:4:"cell";i:1;s:2:"id";i:3;s:9:"widget_id";s:36:"66507fdd-dae2-455b-a5fa-c6ceffcb39e7";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}s:10:"new_window";b:0;}i:4;a:5:{s:4:"type";s:6:"visual";s:5:"title";s:0:"";s:4:"text";s:563:"<h3>Iván Ruiseñor</h3><p><strong>Descripción:</strong> Es una persona amigable, bastante elegante a la hora de vestir, valores definidos, respetuoso y competitivo.Actualmente se encuentra estudiando canto y composición musical como carrera profesional.</p><p><strong>Personalidad:</strong> Tiene buena presencia y bastante galantería, pero tiene claro que eso no le da derecho a la grosería, por eso, como le enseño su mamá, trata a sus amigas con respeto y caballerosidad, logrando que, de su melodiosa voz, jamás salgan sandeces ni palabras soeces.</p>";s:6:"filter";s:1:"1";s:11:"panels_info";a:6:{s:5:"class";s:30:"WP_Widget_Black_Studio_TinyMCE";s:4:"grid";i:1;s:4:"cell";i:1;s:2:"id";i:4;s:9:"widget_id";s:36:"50aed767-6d25-4381-85cb-6ddf6e22a04b";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}}i:5;a:13:{s:5:"image";i:124;s:14:"image_fallback";s:0:"";s:4:"size";s:4:"full";s:5:"align";s:7:"default";s:5:"title";s:0:"";s:14:"title_position";s:6:"hidden";s:3:"alt";s:0:"";s:3:"url";s:0:"";s:5:"bound";b:1;s:10:"full_width";b:1;s:12:"_sow_form_id";s:13:"58dedfd485e70";s:11:"panels_info";a:6:{s:5:"class";s:30:"SiteOrigin_Widget_Image_Widget";s:4:"grid";i:1;s:4:"cell";i:2;s:2:"id";i:5;s:9:"widget_id";s:36:"1202cf56-60f8-46ca-8a2c-e4cdd21f0387";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}s:10:"new_window";b:0;}i:6;a:5:{s:4:"type";s:6:"visual";s:5:"title";s:0:"";s:4:"text";s:555:"<h3>Tati Hormiga</h3><p><strong>Descripción:</strong> Es una persona carismática, dispuesta a ayudar, le agrada socializarse con las personas y para ello construye o se integra a grupos de trabajo.Se desempeña como comunicadora social y lidera varios proyectos académicos y laborales.</p><p><strong>Personalidad:</strong> Que su tamaño no los confunda, ella es una gran líder sin lugar a duda. A grandes y pequeños ella trata igual, formando grupos en sus asignaturas es organizada y muy social, distribuye el trabajo y dirige de forma natural.</p>";s:6:"filter";s:1:"1";s:11:"panels_info";a:6:{s:5:"class";s:30:"WP_Widget_Black_Studio_TinyMCE";s:4:"grid";i:1;s:4:"cell";i:2;s:2:"id";i:6;s:9:"widget_id";s:36:"be80c75e-179b-4a11-bd65-5fe665f03d6d";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}}i:7;a:13:{s:5:"image";i:125;s:14:"image_fallback";s:0:"";s:4:"size";s:4:"full";s:5:"align";s:7:"default";s:5:"title";s:0:"";s:14:"title_position";s:6:"hidden";s:3:"alt";s:0:"";s:3:"url";s:0:"";s:5:"bound";b:1;s:10:"full_width";b:1;s:12:"_sow_form_id";s:13:"58dee04c00221";s:11:"panels_info";a:6:{s:5:"class";s:30:"SiteOrigin_Widget_Image_Widget";s:4:"grid";i:2;s:4:"cell";i:0;s:2:"id";i:7;s:9:"widget_id";s:36:"599156ab-69c9-4ba7-90e8-403ceaf79291";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}s:10:"new_window";b:0;}i:8;a:5:{s:4:"type";s:6:"visual";s:5:"title";s:0:"";s:4:"text";s:596:"<h3>Andrés Gallo</h3><p><strong>Descripción:</strong> Es una persona muy puntual, le encanta socializar con las personas. El reconoce el trabajo duro de las personas y a su vez hace parte importante en el apoyo de sus compañeros con asesorías de extra clase.</p><p><strong>Personalidad:</strong> Es un personaje que siempre madruga, que nunca llega tarde, son algunas teorías sobre el puntual Andrés.Debo decirle que están en lo correcto, desde el primer día que iniciaron sus estudios, se puso a el mismo un gran reto: La puntualidad y asistencia lo caracterizarían en todo momento.</p>";s:6:"filter";s:1:"1";s:11:"panels_info";a:6:{s:5:"class";s:30:"WP_Widget_Black_Studio_TinyMCE";s:4:"grid";i:2;s:4:"cell";i:0;s:2:"id";i:8;s:9:"widget_id";s:36:"d9756be1-c1f2-4bd5-adec-6fdcdd6a052d";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}}i:9;a:13:{s:5:"image";i:126;s:14:"image_fallback";s:0:"";s:4:"size";s:4:"full";s:5:"align";s:7:"default";s:5:"title";s:0:"";s:14:"title_position";s:6:"hidden";s:3:"alt";s:0:"";s:3:"url";s:0:"";s:5:"bound";b:1;s:10:"full_width";b:1;s:12:"_sow_form_id";s:13:"58dee05dc95ff";s:11:"panels_info";a:6:{s:5:"class";s:30:"SiteOrigin_Widget_Image_Widget";s:4:"grid";i:2;s:4:"cell";i:1;s:2:"id";i:9;s:9:"widget_id";s:36:"4be3c689-201d-4dc2-b4a8-070b30c3e5be";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}s:10:"new_window";b:0;}i:10;a:5:{s:4:"type";s:6:"visual";s:5:"title";s:0:"";s:4:"text";s:611:"<h3>Fabián Canario</h3><p><strong>Descripción:</strong> Es un pequeñín sin igual, sus buenos modales no son cuestión del azar. Una excelente educación en la universidad y en el hogar, crearon reglas básicas que lo hacen resaltar: Un saludo, un por favor y dar las gracias nunca están de más.</p><p><strong>Personalidad:</strong> Es una persona comprometida con sus deberes, sus ganas de ayudar a los demás sin pedir nada a cambio hace que otros le tengan envidia. A él no le importa ayudar ni dedicarles tiempo a los problemas de los demás, siempre y cuando él se encuentre haciendo lo correcto</p>";s:6:"filter";s:1:"1";s:11:"panels_info";a:6:{s:5:"class";s:30:"WP_Widget_Black_Studio_TinyMCE";s:4:"grid";i:2;s:4:"cell";i:1;s:2:"id";i:10;s:9:"widget_id";s:36:"9f9d9ec2-8af1-4a42-9d19-ef062e8420db";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}}i:11;a:13:{s:5:"image";i:127;s:14:"image_fallback";s:0:"";s:4:"size";s:4:"full";s:5:"align";s:7:"default";s:5:"title";s:0:"";s:14:"title_position";s:6:"hidden";s:3:"alt";s:0:"";s:3:"url";s:0:"";s:5:"bound";b:1;s:10:"full_width";b:1;s:12:"_sow_form_id";s:13:"58dee06966093";s:11:"panels_info";a:6:{s:5:"class";s:30:"SiteOrigin_Widget_Image_Widget";s:4:"grid";i:2;s:4:"cell";i:2;s:2:"id";i:11;s:9:"widget_id";s:36:"fa2fe5fa-50f0-4ed0-9a6f-f75ca4484c78";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}s:10:"new_window";b:0;}i:12;a:5:{s:4:"type";s:6:"visual";s:5:"title";s:0:"";s:4:"text";s:614:"<h3>Ana Pantera</h3><p><strong>Descripción:</strong> Ana tiene buenos amigos y un gran grupo social, los sigue a todos lados y los apoya sin dudar. Pero si algo no le parece o ve que la puede afectar, no se toma ni un segundo para pensar, sus buenos principios los defiende y no los va a negociar.</p><p><strong>Personalidad:</strong> Se caracteriza por ser amable, alegre y positiva, tiene un sentido muy fuerte de ser útil a sus amigos, por lo que hará lo que esté en sus manos para poder ayudarlos en exámenes difíciles o momentos que sea desafiantes. Tiene una voluntad fuerte y se niega a renunciar.</p>";s:6:"filter";s:1:"1";s:11:"panels_info";a:6:{s:5:"class";s:30:"WP_Widget_Black_Studio_TinyMCE";s:4:"grid";i:2;s:4:"cell";i:2;s:2:"id";i:12;s:9:"widget_id";s:36:"6f357929-615b-459b-bfa2-c9bbf9d96721";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}}i:13;a:13:{s:5:"image";i:128;s:14:"image_fallback";s:0:"";s:4:"size";s:4:"full";s:5:"align";s:7:"default";s:5:"title";s:0:"";s:14:"title_position";s:6:"hidden";s:3:"alt";s:0:"";s:3:"url";s:0:"";s:5:"bound";b:1;s:10:"full_width";b:1;s:12:"_sow_form_id";s:13:"58dee0b5bf489";s:11:"panels_info";a:6:{s:5:"class";s:30:"SiteOrigin_Widget_Image_Widget";s:4:"grid";i:3;s:4:"cell";i:0;s:2:"id";i:13;s:9:"widget_id";s:36:"fa461591-57ff-465b-b8a9-7020acdc7678";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}s:10:"new_window";b:0;}i:14;a:5:{s:4:"type";s:6:"visual";s:5:"title";s:0:"";s:4:"text";s:524:"<h3>Daniela Jirafa</h3><p><strong>Descripción:</strong> Caracterizada por ser un personaje talentoso e inteligente. Su estatura está representada en su capacidad de movimiento y agilidad física. Tiene la actitud para evitar cualquier tipo de irresponsabilidad académica y el discernimiento para caer en suplantaciones de trabajos.</p><p><strong>Personalidad:</strong> Es un personaje responsable y autodidacta con grandes aptitudes y cualidades para cumplir a cabalidad el desarrollo de metas y objetivos planteados.</p>";s:6:"filter";s:1:"1";s:11:"panels_info";a:6:{s:5:"class";s:30:"WP_Widget_Black_Studio_TinyMCE";s:4:"grid";i:3;s:4:"cell";i:0;s:2:"id";i:14;s:9:"widget_id";s:36:"c58de618-d616-4d0e-aafa-5b3721e24603";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}}i:15;a:13:{s:5:"image";i:129;s:14:"image_fallback";s:0:"";s:4:"size";s:4:"full";s:5:"align";s:7:"default";s:5:"title";s:0:"";s:14:"title_position";s:6:"hidden";s:3:"alt";s:0:"";s:3:"url";s:0:"";s:5:"bound";b:1;s:10:"full_width";b:1;s:12:"_sow_form_id";s:13:"58dee0c5c7d4d";s:11:"panels_info";a:6:{s:5:"class";s:30:"SiteOrigin_Widget_Image_Widget";s:4:"grid";i:3;s:4:"cell";i:1;s:2:"id";i:15;s:9:"widget_id";s:36:"df38fcff-ca97-415b-8b14-4288a5b1e876";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}s:10:"new_window";b:0;}i:16;a:5:{s:4:"type";s:6:"visual";s:5:"title";s:0:"";s:4:"text";s:582:"<h3>Cata Cierva</h3><p><strong>Descripción:</strong> Siempre una cara tierna y una sonrisa despierta, para Cata la amabilidad es su mejor receta, por eso saludar y dar las gracias, son pasos básicos, que, para ella, ayudan a tratar bien a la gente.</p><p><strong>Personalidad:</strong> Se caracteriza por ser reflexiva, serena, muy educada, bondadosa. Ella ha demostrado ser muy empática, y debido a su educación la rodean de personas iguales a ella. Si le pides ayuda siempre te dará un sí, y si necesitas un consejo ella no perderá el tiempo y te lo dará sin dudarlo.</p>";s:6:"filter";s:1:"1";s:11:"panels_info";a:6:{s:5:"class";s:30:"WP_Widget_Black_Studio_TinyMCE";s:4:"grid";i:3;s:4:"cell";i:1;s:2:"id";i:16;s:9:"widget_id";s:36:"95e5314e-19de-40d1-aa46-68bfa4dde171";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}}i:17;a:12:{s:5:"image";i:0;s:14:"image_fallback";s:0:"";s:4:"size";s:4:"full";s:5:"align";s:7:"default";s:5:"title";s:0:"";s:14:"title_position";s:6:"hidden";s:3:"alt";s:0:"";s:3:"url";s:0:"";s:5:"bound";b:1;s:11:"panels_info";a:6:{s:5:"class";s:30:"SiteOrigin_Widget_Image_Widget";s:4:"grid";i:3;s:4:"cell";i:2;s:2:"id";i:17;s:9:"widget_id";s:36:"eedec36a-ce89-42bc-a3bc-bc28b48a35ef";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}s:10:"new_window";b:0;s:10:"full_width";b:0;}i:18;a:5:{s:4:"type";s:6:"visual";s:5:"title";s:0:"";s:4:"text";s:0:"";s:6:"filter";s:1:"1";s:11:"panels_info";a:6:{s:5:"class";s:30:"WP_Widget_Black_Studio_TinyMCE";s:4:"grid";i:3;s:4:"cell";i:2;s:2:"id";i:18;s:9:"widget_id";s:36:"2687f2b5-397c-4e84-a497-397f97789e8c";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}}i:19;a:12:{s:5:"image";i:0;s:14:"image_fallback";s:0:"";s:4:"size";s:4:"full";s:5:"align";s:7:"default";s:5:"title";s:0:"";s:14:"title_position";s:6:"hidden";s:3:"alt";s:0:"";s:3:"url";s:0:"";s:5:"bound";b:1;s:11:"panels_info";a:6:{s:5:"class";s:30:"SiteOrigin_Widget_Image_Widget";s:4:"grid";i:4;s:4:"cell";i:0;s:2:"id";i:19;s:9:"widget_id";s:36:"8175e0cf-c602-4455-9e6e-932bee545793";s:5:"style";a:2:{s:27:"background_image_attachment";b:0;s:18:"background_display";s:4:"tile";}}s:10:"new_window";b