(58, 1, '2017-02-10 23:19:42', '2017-02-11 04:19:42', '	<h1>Schedule a Visit</h1>\r\n<p>Call or email to schedule a 3 day retreat or check out our work.</p>\r\n	<p style="text-align: center;"><a href="/contact"> Schedule It</a> <a href="/our-work">See Our Work</a></p>', 'Call To Action 1', '', 'publish', 'closed', 'closed', '', 'call-to-action-1', '', '', '2017-02-10 23:19:42', '2017-02-11 04:19:42', '', 0, 'http://localhost:8888/2017/02/10/call-to-action-1/', 0, 'fl-builder-template', '', 0),
(59, 1, '2017-02-10 23:19:42', '2017-02-11 04:19:42', '\n				<img src="http://tylers-storage.s3-us-west-1.amazonaws.com/wp-content/uploads/2015/09/07185720/Begin3.jpg" alt="Begin" itemprop="image" />\n	<h1>Begin</h1><p>After you are settled, you will be given some tea with herbs in it that will help your reflecting process.</p>', 'Right Text, Left Image', '', 'publish', 'closed', 'closed', '', 'right-text-left-image', '', '', '2017-02-10 23:19:42', '2017-02-11 04:19:42', '', 0, 'http://localhost:8888/2017/02/10/right-text-left-image/', 0, 'fl-builder-template', '', 0),
(60, 1, '2017-02-10 23:19:42', '2017-02-11 04:19:42', '\n	<h1>Relax</h1><p>When you get to our retreat you will be given space to relax and enjoy nature and the scenery.</p>\n				<img src="http://tylers-storage.s3-us-west-1.amazonaws.com/wp-content/uploads/2015/09/07185740/Relax2.jpg" alt="Relax" itemprop="image" />\n	', 'Left Text, Right Image', '', 'publish', 'closed', 'closed', '', 'left-text-right-image', '', '', '2017-02-10 23:19:42', '2017-02-11 04:19:42', '', 0, 'http://localhost:8888/2017/02/10/left-text-right-image/', 0, 'fl-builder-template', '', 0),
(61, 1, '2017-02-10 23:19:42', '2017-02-11 04:19:42', '\n				<img src="http://tylers-storage.s3-us-west-1.amazonaws.com/wp-content/uploads/2015/09/07185823/photo-1422665717225-1a37f226c92a-e1427761297313-landscape.jpg" alt="photo-1422665717225-1a37f226c92a-e1427761297313-landscape" itemprop="image" />\n	<h3 style="text-align: center;">LOREM IPSUM</h3><p style="text-align: center;">Lorem ipsum dolor sit amet, consectetur adipiscing elit. Curabitur nisl mauris, euismod sit amet vehicula vitae, commodo vel ante. Integer sit amet rutrum odio, a condimentum ligula.</p>\n	<h3 style="text-align: center;">LOREM IPSUM</h3><p style="text-align: center;">Lorem ipsum dolor sit amet, consectetur adipiscing elit. Curabitur nisl mauris, euismod sit amet vehicula vitae, commodo vel ante. Integer sit amet rutrum odio, a condimentum ligula.</p>\n				<img src="http://tylers-storage.s3-us-west-1.amazonaws.com/wp-content/uploads/2015/09/07185805/photo-1416949929422-a1d9c8fe84af-landscape.jpg" alt="photo-1416949929422-a1d9c8fe84af-landscape" itemprop="image" />\n	', '4 Square', '', 'publish', 'closed', 'closed', '', '4-square', '', '', '2017-02-10 23:19:42', '2017-02-11 04:19:42', '', 0, 'http://localhost:8888/2017/02/10/4-square/', 0, 'fl-builder-template', '', 0),
(62, 1, '2017-02-10 23:19:42', '2017-02-11 04:19:42', '\n				<img src="http://tylers-storage.s3-us-west-1.amazonaws.com/wp-content/uploads/2015/09/07185929/Stella-Dog1.jpg" alt="Stella-Dog" itemprop="image" />\n				<img src="http://tylers-storage.s3-us-west-1.amazonaws.com/wp-content/uploads/2015/09/07185910/Tyler-Beach1.jpg" alt="Tyler-Beach" itemprop="image" />\n				<img src="http://tylers-storage.s3-us-west-1.amazonaws.com/wp-content/uploads/2015/09/07185847/Jennifer1.jpg" alt="Jennifer" itemprop="image" />\n	', '3 Image Boxes', '', 'publish', 'closed', 'closed', '', '3-image-boxes', '', '', '2017-02-10 23:19:42', '2017-02-11 04:19:42', '', 0, 'http://localhost:8888/2017/02/10/3-image-boxes/', 0, 'fl-builder-template', '', 0),
(63, 1, '2017-02-10 23:19:42', '2017-02-11 04:19:42', '\n	<h1 style="text-align: center;">A smarter way to do things</h1>\n<p style="text-align: center;">We do things smarter and faster to give you a sense of what can be done.  Our templates allow for rapid development so you don''t need to waste your time on developing and you can just launch your product or service.  You will love it.  Develop your skills and wow people with your amazing website.  Never be at a loss for ideas and always show up.</p>\n<p style="text-align: center;"><a href="http://www.tyler.com">Learn More About This &gt;</a></p>\n				<img src="http://tylers-storage.s3-us-west-1.amazonaws.com/wp-content/uploads/2015/09/07185656/mt-fuji-477832_1920-1580x480.jpg" alt="mt-fuji-477832_1920-1580x480" itemprop="image" />\n	', 'Center Text & Image', '', 'publish', 'closed', 'closed', '', 'center-text-image', '', '', '2017-02-10 23:19:42', '2017-02-11 04:19:42', '', 0, 'http://localhost:8888/2017/02/10/center-text-image/', 0, 'fl-builder-template', '', 0),
(64, 1, '2017-02-10 23:19:42', '2017-02-11 04:19:42', '\n	<p style="text-align: center;">"We keep moving forward, opening new doors, and doing new things, because we''re curious and curiosity keeps leading us down new paths."</p><p style="text-align: center;"><em>- Walt Disney</em></p>', 'Simple Quote', '', 'publish', 'closed', 'closed', '', 'simple-quote', '', '', '2017-02-10 23:19:42', '2017-02-11 04:19:42', '', 0, 'http://localhost:8888/2017/02/10/simple-quote/', 0, 'fl-builder-template', '', 0),
