(73, 1, '2017-02-10 23:39:39', '2017-02-11 04:39:39', '\n	<h1>Higher Still</h1>\n<p>Get back to nature, nature knows that this is the journey of your soul.  Reconnect and rediscover yourself again.</p>\n', 'Inicio', '', 'inherit', 'closed', 'closed', '', '38-revision-v1', '', '', '2017-02-10 23:39:39', '2017-02-11 04:39:39', '', 38, 'http://localhost:8888/2017/02/10/38-revision-v1/', 0, 'revision', '', 0),
(74, 1, '2017-02-10 23:42:57', '2017-02-11 04:42:57', '\n	<h1>Higher Still</h1>\n<p>Get back to nature, nature knows that this is the journey of your soul.  Reconnect and rediscover yourself again.</p>\n	<p style="text-align: center;">iPhone 6 isn’t simply bigger — it’s better in every way. Larger, yet dramatically thinner. More powerful, but remarkably power efficient. With a smooth metal surface that seamlessly meets the new Retina HD display. It’s one continuous form where hardware and software function in perfect unison, creating a new generation of iPhone that’s better by any measure.</p>\n', 'Inicio', '', 'inherit', 'closed', 'closed', '', '38-revision-v1', '', '', '2017-02-10 23:42:57', '2017-02-11 04:42:57', '', 38, 'http://localhost:8888/2017/02/10/38-revision-v1/', 0, 'revision', '', 0),
(76, 1, '2017-02-10 23:49:26', '2017-02-11 04:49:26', '<h3 class="widget-title">¿Qué es el Pacto?</h3>Es un compromiso contigo, es un pacto que firmas de corazón y con el cual aportas a nuestro objetivo de celebrar los buenos comportamientos de los miembros de la familia grancolombiana.\r\nQueremos que sepas que desde el primer día en que llegas a la Institución, nosotros asumimos el compromiso de guiarte en tu proyecto profesional y de vida y por ello, incentivamos las buenas actitudes, porque te facilitarán la toma de decisiones responsable y autónoma por el resto de tu vida.\r\nEn ese sentido, es a través de este pacto de honor que expresamos nuestro rechazo hacia las conductas anti éticas y que se alejan de los valores grancolombianos, como el respeto, la tolerancia y principalmente la HONESTIDAD.\r\nEs por ello que nos declaramos enemigos del fraude, el plagio y la suplantación y es hora de que tú también lo hagas.<h3 class="widget-title">Características</h3>-  Deben estar los personajes de la campaña.\r\n-  Libertad del comportamiento en el juego.', 'Inicio', '', 'inherit', 'closed', 'closed', '', '38-revision-v1', '', '', '2017-02-10 23:49:26', '2017-02-11 04:49:26', '', 38, 'http://localhost:8888/2017/02/10/38-revision-v1/', 0, 'revision', '', 0),
(77, 1, '2017-02-10 23:51:42', '2017-02-11 04:51:42', '<h3 class="widget-title">¿Qué es el Pacto?</h3>\r\nEs un compromiso contigo, es un pacto que firmas de corazón y con el cual aportas a nuestro objetivo de celebrar los buenos comportamientos de los miembros de la familia grancolombiana.\r\nQueremos que sepas que desde el primer día en que llegas a la Institución, nosotros asumimos el compromiso de guiarte en tu proyecto profesional y de vida y por ello, incentivamos las buenas actitudes, porque te facilitarán la toma de decisiones responsable y autónoma por el resto de tu vida.\r\nEn ese sentido, es a través de este pacto de honor que expresamos nuestro rechazo hacia las conductas anti éticas y que se alejan de los valores grancolombianos, como el respeto, la tolerancia y principalmente la HONESTIDAD.\r\nEs por ello que nos declaramos enemigos del fraude, el plagio y la suplantación y es hora de que tú también lo hagas.\r\n<h3 class="widget-title">Características</h3>\r\n- Deben estar los personajes de la campaña.\r\n- Libertad del comportamiento en el juego.', 'Inicio', '', 'inherit', 'closed', 'closed', '', '38-revision-v1', '', '', '2017-02-10 23:51:42', '2017-02-11 04:51:42', '', 38, 'http://localhost:8888/2017/02/10/38-revision-v1/', 0, 'revision', '', 0),
