(101, 1, '2017-03-31 16:36:04', '2017-03-31 21:36:04', '<p style="text-align: center;"><span style="font-size: 14pt;">Conoce nuestro equipo de desarrollo que lleva a realidad este proyecto.</span></p>\r\n\r\n<h1 style="text-align: center;">Líderes de Proyecto</h1>\r\n\r\n<hr />\r\n\r\n<img class="so-widget-image" src="http://localhost:8888/wp-content/uploads/2017/03/uyhgf.png" srcset="http://localhost:8888/wp-content/uploads/2017/03/uyhgf.png 500w, http://localhost:8888/wp-content/uploads/2017/03/uyhgf-150x150.png 150w, http://localhost:8888/wp-content/uploads/2017/03/uyhgf-300x300.png 300w, http://localhost:8888/wp-content/uploads/2017/03/uyhgf-370x370.png 370w" width="500" height="500" />\r\n<p style="text-align: center;"><span style="font-size: 14pt;">Diego Ivan\r\nOliveros Acosta</span></p>\r\n<img class="so-widget-image" src="http://localhost:8888/wp-content/uploads/2017/03/6543.png" srcset="http://localhost:8888/wp-content/uploads/2017/03/6543.png 500w, http://localhost:8888/wp-content/uploads/2017/03/6543-150x150.png 150w, http://localhost:8888/wp-content/uploads/2017/03/6543-300x300.png 300w, http://localhost:8888/wp-content/uploads/2017/03/6543-370x370.png 370w" width="500" height="500" />\r\n<p style="text-align: center;"><span style="font-size: 14pt;">Julian Yezid</span>\r\n<span style="font-size: 14pt;">Olarte Ramos</span></p>\r\n\r\n<h1 style="text-align: center;"></h1>\r\n<h1 style="text-align: center;">Product Owner</h1>\r\n\r\n<hr />\r\n\r\n<img class="so-widget-image" src="http://localhost:8888/wp-content/uploads/2017/03/f.png" srcset="http://localhost:8888/wp-content/uploads/2017/03/f.png 500w, http://localhost:8888/wp-content/uploads/2017/03/f-150x150.png 150w, http://localhost:8888/wp-content/uploads/2017/03/f-300x300.png 300w, http://localhost:8888/wp-content/uploads/2017/03/f-370x370.png 370w" width="500" height="500" />\r\n<p style="text-align: center;"><span style="font-size: 14pt;">Camila Andrea</span>\r\n<span style="font-size: 14pt;">Gutié