(142, 1, '2017-03-31 18:32:43', '2017-03-31 23:32:43', '<img src="http://localhost:8888/wp-content/uploads/2017/03/portada-corta-buenos.jpg" width="1772" height="531" srcset="http://localhost:8888/wp-content/uploads/2017/03/portada-corta-buenos.jpg 1772w, http://localhost:8888/wp-content/uploads/2017/03/portada-corta-buenos-300x90.jpg 300w, http://localhost:8888/wp-content/uploads/2017/03/portada-corta-buenos-768x230.jpg 768w, http://localhost:8888/wp-content/uploads/2017/03/portada-corta-buenos-1024x307.jpg 1024w, http://localhost:8888/wp-content/uploads/2017/03/portada-corta-buenos-370x111.jpg 370w, http://localhost:8888/wp-content/uploads/2017/03/portada-corta-buenos-1040x312.jpg 1040w" title="portada corta buenos" class="so-widget-image">\r\n<img src="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO-1200X1200PX.jpg" width="1772" height="1342" srcset="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO-1200X1200PX.jpg 1772w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO-1200X1200PX-300x227.jpg 300w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO-1200X1200PX-768x582.jpg 768w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO-1200X1200PX-1024x776.jpg 1024w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO-1200X1200PX-370x280.jpg 370w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO-1200X1200PX-1040x788.jpg 1040w" title="PACTO DE HONOR- FACEBOOK POSITIVO-1200X1200PX" class="so-widget-image">\r\n<h3>Daniel León y Pedro Ratón</h3><p><strong>Descripción:</strong> Personajes con grandes cualidades de responsabilidad y compromiso académico. Evitan de manera incondicional cualquier tipo de trabajos de información imprecisa y ausente de fuentes de propiedad intelectual.</p><p><strong>Personalidad:</strong> Daniel caracterizado por su fuerza, agilidad e inteligencia en sus combates. De la misma manera, Pedro se destaca por su apariencia pequeña, pero con una gran intuición y agilidad mental frente a los combates.</p>\r\n<img src="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO2-1200X1200PX.jpg" width="1417" height="1049" srcset="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO2-1200X1200PX.jpg 1417w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO2-1200X1200PX-300x222.jpg 300w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO2-1200X1200PX-768x569.jpg 768w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO2-1200X1200PX-1024x758.jpg 1024w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO2-1200X1200PX-370x274.jpg 370w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO2-1200X1200PX-1040x770.jpg 1040w" title="PACTO DE HONOR- FACEBOOK POSITIVO2-1200X1200PX" class="so-widget-image">\r\n<h3>Iván Ruiseñor</h3><p><strong>Descripción:</strong> Es una persona amigable, bastante elegante a la hora de vestir, valores definidos, respetuoso y competitivo.Actualmente se encuentra estudiando canto y composición musical como carrera profesional.</p><p><strong>Personalidad:</strong> Tiene buena presencia y bastante galantería, pero tiene claro que eso no le da derecho a la grosería, por eso, como le enseño su mamá, trata a sus amigas con respeto y caballerosidad, logrando que, de su melodiosa voz, jamás salgan sandeces ni palabras soeces.</p>\r\n<img src="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO3-1200X1200PX.jpg" width="1772" height="1361" srcset="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO3-1200X1200PX.jpg 1772w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO3-1200X1200PX-300x230.jpg 300w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO3-1200X1200PX-768x590.jpg 768w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO3-1200X1200PX-1024x786.jpg 1024w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO3-1200X1200PX-370x284.jpg 370w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO3-1200X1200PX-1040x799.jpg 1040w" title="PACTO DE HONOR- FACEBOOK POSITIVO3-1200X1200PX" class="so-widget-image">\r\n<h3>Tati Hormiga</h3><p><strong>Descripción:</strong> Es una persona carismática, dispuesta a ayudar, le agrada socializarse con las personas y para ello construye o se integra a grupos de trabajo.Se desempeña como comunicadora social y lidera varios proyectos académicos y laborales.</p><p><strong>Personalidad:</strong> Que su tamaño no los confunda, ella es una gran líder sin lugar a duda. A grandes y pequeños ella trata igual, formando grupos en sus asignaturas es organizada y muy social, distribuye el trabajo y dirige de forma natural.</p>\r\n<img src="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO4-1200X1200PX.jpg" width="1772" height="1357" srcset="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO4-1200X1200PX.jpg 1772w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO4-1200X1200PX-300x230.jpg 300w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO4-1200X1200PX-768x588.jpg 768w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO4-1200X1200PX-1024x784.jpg 1024w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO4-1200X1200PX-370x283.jpg 370w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO4-1200X1200PX-1040x796.jpg 1040w" title="PACTO DE HONOR- FACEBOOK POSITIVO4-1200X1200PX" class="so-widget-image">\r\n<h3>Andrés Gallo</h3><p><strong>Descripción:</strong> Es una persona muy puntual, le encanta socializar con las personas. El reconoce el trabajo duro de las personas y a su vez hace parte importante en el apoyo de sus compañeros con asesorías de extra clase.</p><p><strong>Personalidad:</strong> Es un personaje que siempre madruga, que nunca llega tarde, son algunas teorías sobre el puntual Andrés.Debo decirle que están en lo correcto, desde el primer día que iniciaron sus estudios, se puso a el mismo un gran reto: La puntualidad y asistencia lo caracterizarían en todo momento.</p>\r\n<img src="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO5-1200X1200PX.jpg" width="1772" height="1374" srcset="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO5-1200X1200PX.jpg 1772w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO5-1200X1200PX-300x233.jpg 300w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO5-1200X1200PX-768x596.jpg 768w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO5-1200X1200PX-1024x794.jpg 1024w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO5-1200X1200PX-370x287.jpg 370w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO5-1200X1200PX-1040x806.jpg 1040w" title="PACTO DE HONOR- FACEBOOK POSITIVO5-1200X1200PX" class="so-widget-image">\r\n<h3>Fabián Canario</h3><p><strong>Descripción:</strong> Es un pequeñín sin igual, sus buenos modales no son cuestión del azar. Una excelente educación en la universidad y en el hogar, crearon reglas básicas que lo hacen resaltar: Un saludo, un por favor y dar las gracias nunca están de más.</p><p><strong>Personalidad:</strong> Es una persona comprometida con sus deberes, sus ganas de ayudar a los demás sin pedir nada a cambio hace que otros le tengan envidia. A él no le importa ayudar ni dedicarles tiempo a los problemas de los demás, siempre y cuando él se encuentre haciendo lo correcto</p>\r\n<img src="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO6-1200X1200PX.jpg" width="1772" height="1413" srcset="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO6-1200X1200PX.jpg 1772w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO6-1200X1200PX-300x239.jpg 300w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO6-1200X1200PX-768x612.jpg 768w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO6-1200X1200PX-1024x817.jpg 1024w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO6-1200X1200PX-370x295.jpg 370w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO6-1200X1200PX-1040x829.jpg 1040w" title="PACTO DE HONOR- FACEBOOK POSITIVO6-1200X1200PX" class="so-widget-image">\r\n<h3>Ana Pantera</h3><p><strong>Descripción:</strong> Ana tiene buenos amigos y un gran grupo social, los sigue a todos lados y los apoya sin dudar. Pero si algo no le parece o ve que la puede afectar, no se toma ni un segundo para pensar, sus buenos principios los defiende y no los va a negociar.</p><p><strong>Personalidad:</strong> Se caracteriza por ser amable, alegre y positiva, tiene un sentido muy fuerte de ser útil a sus amigos, por lo que hará lo que esté en sus manos para poder ayudarlos en exámenes difíciles o momentos que sea desafiantes. Tiene una voluntad fuerte y se niega a renunciar.</p>\r\n<img src="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO7-1200X1200PX.jpg" width="1772" height="1368" srcset="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO7-1200X1200PX.jpg 1772w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO7-1200X1200PX-300x232.jpg 300w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO7-1200X1200PX-768x593.jpg 768w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO7-1200X1200PX-1024x791.jpg 1024w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO7-1200X1200PX-370x286.jpg 370w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO7-1200X1200PX-1040x803.jpg 1040w" title="PACTO DE HONOR- FACEBOOK POSITIVO7-1200X1200PX" class="so-widget-image">\r\n<h3>Daniela Jirafa</h3><p><strong>Descripción:</strong> Caracterizada por ser un personaje talentoso e inteligente. Su estatura está representada en su capacidad de movimiento y agilidad física. Tiene la actitud para evitar cualquier tipo de irresponsabilidad académica y el discernimiento para caer en suplantaciones de trabajos.</p><p><strong>Personalidad:</strong> Es un personaje responsable y autodidacta con grandes aptitudes y cualidades para cumplir a cabalidad el desarrollo de metas y objetivos planteados.</p>\r\n<img src="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO8-1200X1200PX.jpg" width="1772" height="1432" srcset="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO8-1200X1200PX.jpg 1772w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO8-1200X1200PX-300x242.jpg 300w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO8-1200X1200PX-768x621.jpg 768w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO8-1200X1200PX-1024x828.jpg 1024w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO8-1200X1200PX-370x299.jpg 370w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-POSITIVO8-1200X1200PX-1040x840.jpg 1040w" title="PACTO DE HONOR- FACEBOOK POSITIVO8-1200X1200PX" class="so-widget-image">\r\n<h3>Cata Cierva</h3><p><strong>Descripción:</strong> Siempre una cara tierna y una sonrisa despierta, para Cata la amabilidad es su mejor receta, por eso saludar y dar las gracias, son pasos básicos, que, para ella, ayudan a tratar bien a la gente.</p><p><strong>Personalidad:</strong> Se caracteriza por ser reflexiva, serena, muy educada,&nbsp;bondadosa. Ella ha demostrado ser muy empática, y debido a su educación la rodean de personas iguales a ella. Si le pides ayuda siempre te dará un sí, y si necesitas un consejo ella no perderá el tiempo y te lo dará sin dudarlo.</p>\r\n<img class="so-widget-image">\r\n<img class="so-widget-image">\r\n<img class="so-widget-image">\r\n<img src="http://localhost:8888/wp-content/uploads/2017/03/portada-corta-malos.jpg" width="5000" height="1384" srcset="http://localhost:8888/wp-content/uploads/2017/03/portada-corta-malos.jpg 5000w, http://localhost:8888/wp-content/uploads/2017/03/portada-corta-malos-300x83.jpg 300w, http://localhost:8888/wp-content/uploads/2017/03/portada-corta-malos-768x213.jpg 768w, http://localhost:8888/wp-content/uploads/2017/03/portada-corta-malos-1024x283.jpg 1024w, http://localhost:8888/wp-content/uploads/2017/03/portada-corta-malos-370x102.jpg 370w, http://localhost:8888/wp-content/uploads/2017/03/portada-corta-malos-1040x288.jpg 1040w" title="PACTO DE HONOR-FACEBOOK NEGATIVO-1200X1200" class="so-widget-image">\r\n<img src="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-13.jpg" width="1201" height="790" srcset="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-13.jpg 1201w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-13-300x197.jpg 300w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-13-768x505.jpg 768w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-13-1024x674.jpg 1024w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-13-370x243.jpg 370w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-13-1040x684.jpg 1040w" title="Imprimir" class="so-widget-image">\r\n<h2>Fabián Babuino</h2><p><strong>Descripción:</strong> Es una persona temperamental, de malgenio, sociable únicamente con su grupo de amigos, conflictiva para ganar territorio y reconocimiento.Su habilidad se caracteriza por su gran fuerza al momento de atacar y excelente defensa.</p><p><strong>Personalidad:</strong> Es una persona explosiva, fuerte en sus contestaciones, bastante volátil y conflictivo. Tiene malas amistades que influyen su vida de manera completa.Bastante territorial y competitivo.</p>\r\n<img src="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-12.jpg" width="2500" height="1650" srcset="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-12.jpg 2500w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-12-300x198.jpg 300w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-12-768x507.jpg 768w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-12-1024x676.jpg 1024w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-12-370x244.jpg 370w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-12-1040x686.jpg 1040w" title="PACTO DE HONOR-FACEBOOK NEGATIVO-1200X1200" class="so-widget-image">\r\n<h3>Victor Hiena</h3><p><strong>Descripción:</strong> Es una persona tranquila, fría, viste muy bien, sin preocupaciones, pero NO es totalmente feliz ya que habla mal de las demás personas.Su habilidad especial se manifiesta al hablar generando un veneno mortal para los oponentes de cualquier clase, por lo tanto, no socializa con nadie, sin embargo, por intuición cree que puede observar las personas.</p><p><strong>Personalidad:</strong> Es una persona fría, eficaz, con un potente veneno en sus colmillos, excelente agilidad, nada de socialización con las personas, buen trabajo grupal pero un nivel de hipocresía superior.</p>\r\n<img src="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-11.jpg" width="1201" height="779" srcset="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-11.jpg 1201w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-11-300x195.jpg 300w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-11-768x498.jpg 768w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-11-1024x664.jpg 1024w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-11-370x240.jpg 370w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-11-1040x675.jpg 1040w" title="Imprimir" class="so-widget-image">\r\n<h3>Nicolás Lagarto</h3><p><strong>Descripción:</strong> Es una persona alegre, perezoso, y deportista. Bastante competitivo y cuenta con unas orejas pequeñas que permiten escuchar a más distancia de lo habitual.</p><p><strong>Personalidad:</strong> Es una persona alegre, inteligente y sociable.Actualmente es un nadador profesional, pero no distribuye correctamente sus espacios y siempre pide ayuda a sus amigos la inclusión de su nombre en trabajos estudiantiles o resúmenes laborales.Su habilidad le permite cambiar de grupo según quien vaya ganando, pero tiene efectos negativos sobre los puntos del grupo en general.</p>\r\n<img src="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-10.jpg" width="1201" height="783" srcset="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-10.jpg 1201w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-10-300x196.jpg 300w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-10-768x501.jpg 768w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-10-1024x668.jpg 1024w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-10-370x241.jpg 370w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-10-1040x678.jpg 1040w" title="Imprimir" class="so-widget-image">\r\n<h3>Julián Burro</h3><p><strong>Descripción:</strong> Una persona de estrato medio, que intenta obtener logros para su beneficio a costa de los demás. Es conocido por contratar terceros para hacer sus trabajos y parciales estudiantiles, avances laborales y proyectos.Su habilidad es conseguir equipamiento sin necesidad de gemas ni códigos.</p><p><strong>Personalidad:</strong> Es una persona chistosa, facilista, y mentirosa. Habla más de la cuenta sobre sus trabajos, para demostrar que realizo con sus propias manos lo solicitado a los terceros. Le encanta festejar los engaños a docentes en la universidad y jefes en la empresa donde labora.</p>\r\n<img src="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-09.jpg" width="1201" height="775" srcset="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-09.jpg 1201w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-09-300x194.jpg 300w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-09-768x496.jpg 768w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-09-1024x661.jpg 1024w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-09-370x239.jpg 370w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-09-1040x671.jpg 1040w" title="Imprimir" class="so-widget-image">\r\n<h3>Luis Víbora</h3><p><strong>Descripción:</strong> Es una persona reservada, tranquila y veloz. Su agilidad le ha permitido incluirse en el top 10 de las personas más recurrentes en fraudes de Copyright informático.Cuenta con la habilidad de morder a su oponente e incluir sus poderes instantáneamente a su lista.</p><p><strong>Personalidad:</strong> Es una persona naturalmente solitaria, aprovecha su tiempo al máximo para realizar descargas frecuentes de Internet y romper los derechos de autor Copyright para su beneficio monetario.</p>\r\n<img src="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-08.jpg" width="1201" height="752" srcset="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-08.jpg 1201w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-08-300x188.jpg 300w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-08-768x481.jpg 768w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-08-1024x641.jpg 1024w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-08-370x232.jpg 370w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-08-1040x651.jpg 1040w" title="Imprimir" class="so-widget-image">\r\n<h3>Juan Camaleón</h3><p><strong>Descripción:</strong> Es una persona inteligente, cumplida al momento de entregar los temas pendientes a su cargo, buen compañero, poco sociable, pero en busca de ser aceptado por las personas.En busca de ser aceptado suplanta a sus amigos en los parciales o trabajos.Su habilidad especial es realizar ataques sorpresa con invisibilidad.</p><p><strong>Personalidad:</strong> Es una persona comprometida con sus deberes, reflejando buenos valores y poco conflictivo. Sin embargo, depende de la opinión de los demás para tomar alguna decisión laboral, estudiantil o sentimental.</p>\r\n<img src="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-07.jpg" width="1201" height="754" srcset="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-07.jpg 1201w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-07-300x188.jpg 300w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-07-768x482.jpg 768w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-07-1024x643.jpg 1024w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-07-370x232.jpg 370w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-07-1040x653.jpg 1040w" title="Imprimir" class="so-widget-image">\r\n<h3>Carlos Buitre</h3><p><strong>Descripción:</strong> Es una persona perspicaz, aparenta una vida correcta y realizada, pero en el fondo existe una persona engañosa y estafadora. Su habilidad principal es falsificar documentos para escabullirse de cualquier evento que pueda afectar su imagen y sobre todo sus planes. Utiliza razones falsas para derrotar a sus oponentes.</p><p><strong>Personalidad:</strong> Es una persona con actitud amable y de servicio, hace muchos amigos para después engañar y aprovecharse de las situaciones que lo benefician. Poco después de sus cometidos, desaparece sin dejar rastro. Conserva una excelente vista, para cazar a sus oponentes más ingenuos.</p>\r\n<img src="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-06.jpg" width="1201" height="828" srcset="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-06.jpg 1201w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-06-300x207.jpg 300w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-06-768x529.jpg 768w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-06-1024x706.jpg 1024w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-06-370x255.jpg 370w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-06-1040x717.jpg 1040w" title="Imprimir" class="so-widget-image">\r\n<h3>Felipe Oso</h3><p><strong>Descripción:</strong> Es una persona que viste muy formal, pero no debes confiar en su apariencia. Es conocido por no sonreír, por su indisposición ante las situaciones y especialista en copiar movimientos, poderes y gestos.Intuitivamente puede obtener los poderes de sus compañeros o enemigos para su beneficio propio.</p><p><strong>Personalidad:</strong> Es una persona que en un mundo de fraude se siente triste, desanimo, pierde el brillo en sus ojos, cabizbajo y frustrado.</p>\r\n<img src="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-05.jpg" width="1201" height="834" srcset="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-05.jpg 1201w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-05-300x208.jpg 300w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-05-768x533.jpg 768w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-05-1024x711.jpg 1024w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-05-370x257.jpg 370w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-05-1040x722.jpg 1040w" title="Imprimir" class="so-widget-image">\r\n<h3>Camilo Perezoso</h3><p><strong>Descripción:</strong> Casual, al mantener una de sus manos en el bolsillo, indica la falta de compromiso con el estudio y sobre todo el poco interés para tomar decisiones en cualquier ámbito de su vida.Sus ojos bien abiertos, pero con mente distraída y síntomas de cansancio por falta de sueño, debido a sus frecuentes salidas nocturnas. Aparece al final de la batalla con un poderoso ataque.</p><p><strong>Personalidad:</strong> Antes de evidenciar la falta de asistencia y el poco interés por las clases Camilo Perezoso tiene un habitual problema para tomar decisiones y pierde el interés rápidamente por las cosas. Es una persona competitiva.</p>\r\n<img src="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-04.jpg" width="1201" height="865" srcset="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-04.jpg 1201w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-04-300x216.jpg 300w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-04-768x553.jpg 768w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-04-1024x738.jpg 1024w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-04-370x266.jpg 370w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-04-1040x749.jpg 1040w" title="Imprimir" class="so-widget-image">\r\n<h3>Ana y Sara Abeja</h3><p><strong>Descripción:</strong> Son realmente hermosas, les encanta salir a reunirse con sus amigos a compartir, participan poco a clase y sus prioridades siempre son las fiestas y sus amigos que el estudio. Son bastante reconocidas por ser descubiertas realizando fraude en un examen.</p><p><strong>Personalidad:</strong> Ellas son físicamente hermosas, sociables, perezosas, de poco interés por el estudio y les encantan las sesiones de fotos.</p>\r\n<img src="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-03.jpg" width="1201" height="812" srcset="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-03.jpg 1201w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-03-300x203.jpg 300w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-03-768x519.jpg 768w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-03-1024x692.jpg 1024w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-03-370x250.jpg 370w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-03-1040x703.jpg 1040w" title="Imprimir" class="so-widget-image">\r\n<h3>Andrés Zorro</h3><p><strong>Descripción:</strong> Es una persona joven, compañerita y de muy buen ambiente. Sin embargo, se ha visto preocupado e inestable emocionalmente por la serie de evidencias que lo involucran en colarse en sistemas de transporte universitario. Su habilidad tiene como finalidad saltar turnos de batalla para su beneficio.</p><p><strong>Personalidad:</strong> Joven extrovertido, amigable, reconocido en su entorno por ser practicante Parkour. Dicho reconocimiento en público desato un comportamiento extraño y repentino en los paraderos de servicio público.</p>\r\n<img src="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-02.jpg" width="1200" height="832" srcset="http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-02.jpg 1200w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-02-300x208.jpg 300w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-02-768x532.jpg 768w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-02-1024x710.jpg 1024w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-02-370x257.jpg 370w, http://localhost:8888/wp-content/uploads/2017/03/PACTO-DE-HONOR-FACEBOOK-NEGATIVO-1200X1200-02-1040x721.jpg 1040w" title="Imprimir" class="so-widget-image">\r\n<h3>Juan Rata</h3><p><strong>Descripción:</strong> Es una persona que vive en un mundo fraudulento. Se provee de artículos importantes realizar distribuciones a cambio de dinero.Su habilidad principal es quitar parte del equipamiento del oponente únicamente al tocarlo.</p><p><strong>Personalidad:</strong> Es una persona ágil al momento de conseguir información, le encanta el dinero fácil, cuenta con varios contactos que ayudan con la recolección de la información para distribuir posteriormente a los compradores.</p>', 'Personajes', '', 'inherit', 'closed', 'closed', '', '97-revision-v1', '', '', '2017-03-31 18:32:43', '2017-03-31 23:32:43', '', 97, 'http://localhost:8888/2017/03/31/97-revision-v1/', 0, 'revision', '', 0),
(143, 1, '2017-03-31 21:23:13', '2017-04-01 02:23:13', '<p style="text-align: center;"><span style="font-size: 36pt;">Tipos de Plagio</span></p>\r\n\r\n<h3 style="text-align: right;">Clonación</h3>\r\n<p style="text-align: right;">Presentar el trabajo de otra persona como propio, copiado palabra por palabra.</p>\r\n<img class="so-widget-image" src="http://localhost:8888/wp-content/uploads/2017/03/Clonacion.png" srcset="http://localhost:8888/wp-content/uploads/2017/03/Clonacion.png 200w, http://localhost:8888/wp-content/uploads/2017/03/Clonacion-150x150.png 150w" width="200" height="200" />\r\n<img class="so-widget-image" title="COpiado y pegado" src="http://localhost:8888/wp-content/uploads/2017/03/COpiado-y-pegado.png" srcset="http://localhost:8888/wp-content/uploads/2017/03/COpiado-y-pegado.png 200w, http://localhost:8888/wp-content/uploads/2017/03/COpiado-y-pegado-150x150.png 150w" width="200" height="200" />\r\n<h3>Copiado y Pegado</h3>\r\nIncluir amplios pasajes de texto de una única fuente sin modificarlos.\r\n<h3>Búsqueda y Reemplazo</h3>\r\nCambiar palabras y expresiones clave sin alterar el contenido esencial de las fuentes.\r\n\r\n<img class="so-widget-image" src="http://localhost:8888/wp-content/uploads/2017/03/Bisqueda.png" srcset="http://localhost:8888/wp-content/uploads/2017/03/Bisqueda.png 200w, http://localhost:8888/wp-content/uploads/2017/03/Bisqueda-150x150.png 150w" width="200" height="200" />\r\n<img class="so-widget-image" src="http://localhost:8888/wp-content/uploads/2017/03/Remix.png" srcset="http://localhost:8888/wp-content/uploads/2017/03/Remix.png 200w, http://localhost:8888/wp-content/uploads/2017/03/Remix-150x150.png 150w" width="200" height="200" />\r\n<h3>Remix</h3>\r\nMezclar material parafraseado extraído de múltiples fuentes.\r\n<h3>Reciclado</h3>\r\nTomar prestados pasajes amplios de un trabajo propio anterior sin incluir citas.\r\n\r\n<img class="so-widget-image" src="http://localhost:8888/wp-content/uploads/2017/03/Recilcado.png" srcset="http://localhost:8888/wp-content/uploads/2017/03/Recilcado.png 200w, http://localhost:8888/wp-content/uploads/2017/03/Recilcado-150x150.png 150w" width="200" height="200" />\r\n<img class="so-widget-image" src="http://localhost:8888/wp-content/uploads/2017/03/hibrido.png" srcset="http://localhost:8888/wp-content/uploads/2017/03/hibrido.png 200w, http://localhost:8888/wp-content/uploads/2017/03/hibrido-150x150.png 150w" width="200" height="200" />\r\n<h3>Híbrido</h3>\r\nCombinar fuentes perfectamente citadas con fragmentos copiados sin incluir citas.\r\n<h3>Mosaico</h3>\r\nMaterial copiado de múltiples fuentes que encajan bien.\r\n\r\n<img class="so-widget-image" src="http://localhost:8888/wp-content/uploads/2017/03/Mosaico.png" srcset="http://localhost:8888/wp-content/uploads/2017/03/Mosaico.png 200w, http://localhost:8888/wp-content/uploads/2017/03/Mosaico-150x150.png 150w" width="200" height="200" />\r\n<img class="so-widget-image" src="http://localhost:8888/wp-content/uploads/2017/03/404.png" srcset="http://localhost:8888/wp-content/uploads/2017/03/404.png 200w, http://localhost:8888/wp-content/uploads/2017/03/404-150x150.png 150w" width="200" height="200" />\r\n<h3>Error 404</h3>\r\nCitar fuentes inexistentes o incluir información imprecisa sobre fuentes.\r\n<h3>Fuente RSS</h3>\r\nCitar correctamente las fuentes pero casi sin incluir párrafos con creación propia.\r\n\r\n<img class="so-widget-image" title="Fuente RSS" src="http://localhost:8888/wp-content/uploads/2017/03/Fuente-RSS.png" srcset="http://localhost:8888/wp-content/uploads/2017/03/Fuente-RSS.png 200w, http://localhost:8888/wp-content/uploads/2017/03/Fuente-RSS-150x150.png 150w" width="200" height="200" />\r\n<img class="so-widget-image" src="http://localhost:8888/wp-content/uploads/2017/03/Reutilizacion.png" srcset="http://localhost:8888/wp-content/uploads/2017/03/Reutilizacion.png 200w, http://localhost:8888/wp-content/uploads/2017/03/Reutilizacion-150x150.png 150w" width="200" height="200" />\r\n<h3>Reutilización</h3>\r\nCitar correctamente las fuentes haciendo demasiado uso de la estructura y/o los términos originales del texto.', 'Tipos de Plagio', '', 'inherit', 'closed', 'closed', '', '99-autosave-v1', '', '', '2017-03-31 21:23:13', '2017-04-01 02:23:13', '', 99, 'http://localhost:8888/2017/03/31/99-autosave-v1/', 0, 'revision', '', 0),
