(154, 1, '2017-03-31 19:20:23', '2017-04-01 00:20:23', '<p style="text-align: center;"><span style="font-size: 36pt;">Tipos de Plagio</span></p><h3 style="text-align: right;">Clonación</h3><p style="text-align: right;">Presentar el trabajo de otra persona como propio, copiado palabra por palabra.</p>\r\n<img src="http://localhost:8888/wp-content/uploads/2017/03/Clonacion.png" width="200" height="200" srcset="http://localhost:8888/wp-content/uploads/2017/03/Clonacion.png 200w, http://localhost:8888/wp-content/uploads/2017/03/Clonacion-150x150.png 150w" class="so-widget-image">\r\n<img src="http://localhost:8888/wp-content/uploads/2017/03/COpiado-y-pegado.png" width="200" height="200" srcset="http://localhost:8888/wp-content/uploads/2017/03/COpiado-y-pegado.png 200w, http://localhost:8888/wp-content/uploads/2017/03/COpiado-y-pegado-150x150.png 150w" title="COpiado y pegado" class="so-widget-image">\r\n<h3>Copiado y Pegado</h3><p>Incluir amplios pasajes de texto de una única fuente sin modificarlos.</p><h3>Búsqueda y Reemplazo</h3><p>Cambiar palabras y expresiones clave sin alterar el contenido esencial de las fuentes.</p>\r\n<img src="http://localhost:8888/wp-content/uploads/2017/03/Bisqueda.png" width="200" height="200" srcset="http://localhost:8888/wp-content/uploads/2017/03/Bisqueda.png 200w, http://localhost:8888/wp-content/uploads/2017/03/Bisqueda-150x150.png 150w" class="so-widget-image">\r\n<img src="http://localhost:8888/wp-content/uploads/2017/03/Remix.png" width="200" height="200" srcset="http://localhost:8888/wp-content/uploads/2017/03/Remix.png 200w, http://localhost:8888/wp-content/uploads/2017/03/Remix-150x150.png 150w" class="so-widget-image">\r\n<h3>Remix</h3><p>Mezclar material parafraseado extraído de múltiples fuentes.</p><h3>Reciclado</h3><p>Tomar prestados pasajes amplios de un trabajo propio anterior sin incluir citas.</p>\r\n<img src="http://localhost:8888/wp-content/uploads/2017/03/Recilcado.png" width="200" height="200" srcset="http://localhost:8888/wp-content/uploads/2017/03/Recilcado.png 200w, http://localhost:8888/wp-content/uploads/2017/03/Recilcado-150x150.png 150w" class="so-widget-image">\r\n<img src="http://localhost:8888/wp-content/uploads/2017/03/hibrido.png" width="200" height="200" srcset="http://localhost:8888/wp-content/uploads/2017/03/hibrido.png 200w, http://localhost:8888/wp-content/uploads/2017/03/hibrido-150x150.png 150w" class="so-widget-image">\r\n<h3>Híbrido</h3><p>Combinar fuentes perfectamente citadas con fragmentos copiados sin incluir citas.</p><h3>Mosaico</h3><p>Material copiado de múltiples fuentes que encajan bien.</p>\r\n<img src="http://localhost:8888/wp-content/uploads/2017/03/Mosaico.png" width="200" height="200" srcset="http://localhost:8888/wp-content/uploads/2017/03/Mosaico.png 200w, http://localhost:8888/wp-content/uploads/2017/03/Mosaico-150x150.png 150w" class="so-widget-image">\r\n<img src="http://localhost:8888/wp-content/uploads/2017/03/404.png" width="200" height="200" srcset="http://localhost:8888/wp-content/uploads/2017/03/404.png 200w, http://localhost:8888/wp-content/uploads/2017/03/404-150x150.png 150w" class="so-widget-image">\r\n<h3>Error 404</h3><p>Citar fuentes inexistentes o incluir información imprecisa sobre fuentes.</p><h3>Fuente RSS</h3><p>Citar correctamente las fuentes pero casi sin incluir párrafos con creación propia.</p>\r\n<img src="http://localhost:8888/wp-content/uploads/2017/03/Fuente-RSS.png" width="200" height="200" srcset="http://localhost:8888/wp-content/uploads/2017/03/Fuente-RSS.png 200w, http://localhost:8888/wp-content/uploads/2017/03/Fuente-RSS-150x150.png 150w" title="Fuente RSS" class="so-widget-image">\r\n<img src="http://localhost:8888/wp-content/uploads/2017/03/Reutilizacion.png" width="200" height="200" srcset="http://localhost:8888/wp-content/uploads/2017/03/Reutilizacion.png 200w, http://localhost:8888/wp-content/uploads/2017/03/Reutilizacion-150x150.png 150w" class="so-widget-image">\r\n<h3>Reutilización</h3><p>Citar correctamente las fuentes haciendo demasiado uso de la estructura y/o los términos originales del texto.</p>', 'Tipos de Plagio', '', 'inherit', 'closed', 'closed', '', '99-revision-v1', '', '', '2017-03-31 19:20:23', '2017-04-01 00:20:23', '', 99, 'http://localhost:8888/2017/03/31/99-revision-v1/', 0, 'revision', '', 0),
