(197, 1, '2017-04-01 09:56:26', '2017-04-01 14:56:26', '<h3 class="widget-title">¿Qué es el Pacto?</h3>\r\nEs un compromiso contigo, es un pacto que firmas de corazón y con el cual aportas a nuestro objetivo de celebrar los buenos comportamientos de los miembros de la familia grancolombiana.\r\nQueremos que sepas que desde el primer día en que llegas a la Institución, nosotros asumimos el compromiso de guiarte en tu proyecto profesional y de vida y por ello, incentivamos las buenas actitudes, porque te facilitarán la toma de decisiones responsable y autónoma por el resto de tu vida.\r\nEn ese sentido, es a través de este pacto de honor que expresamos nuestro rechazo hacia las conductas anti éticas y que se alejan de los valores grancolombianos, como el respeto, la tolerancia y principalmente la HONESTIDAD.\r\nEs por ello que nos declaramos enemigos del fraude, el plagio y la suplantación y es hora de que tú también lo hagas.\r\n<h3 class="widget-title">Características</h3>\r\n- Deben estar los personajes de la campaña.\r\n- Libertad del comportamiento en el juego.', 'Inicio', '', 'inherit', 'closed', 'closed', '', '38-autosave-v1', '', '', '2017-04-01 09:56:26', '2017-04-01 14:56:26', '', 38, 'http://localhost:8888/2017/04/01/38-autosave-v1/', 0, 'revision', '', 0),
